import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import { FiArrowLeft } from 'react-icons';


export default function NovoCurso(){
    return(
        <div className="novo-curso-container">
            <div className="content">
                <section className="form">
                    <h1>Adicionar Novo Curso</h1>
                    <p>Inclua as Informações do Novo Curso e clique em adicionar!</p>
                    <Link className="back-link" to="/curso">
                        <FiArrowLeft size={16} color="#251FC5"/>
                        Home
                    </Link>
                </section>
                <form>
                    <input placeholder="Descrição"/>
                    <input placeholder="Data de início"/>
                    <input placeholder="Data de término"/>
                    <input placeholder="Quantidade de Alunos"/>
                    <input placeholder="Categoria"/>

                    <button className="button" type="submit">Adicionar</button>
                    
                </form>
            </div>
        </div>

    );

}
